import logo from './logo.svg';
import './App.css';
import Nav from './navigation Bar/nav';
import Main from './main/main';
import Footer from './footer/footer';
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Routes
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Nav />
      <Routes>
      <Route path='/'><Main key="home" category="general" /></Route>
      <Route path='/business'><Main key="business" category="business" /></Route>
      <Route path='/entertainment'><Main key="entertainment" category="entertainment" /></Route>
      <Route path='/general'><Main key="general" category="general" /></Route>
      <Route path='/health'><Main key="health" category="health" /></Route>
      <Route path='/science'><Main key="science" category="science" /></Route>
      <Route path='/sports'><Main key="sports" category="sports" /></Route>
      <Route path='/technology'><Main key="technology" category="technology" /></Route>
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
